import Layout from '../components/Layout'
import Router from 'next/router';
import { useEffect } from 'react'

const Custom404 = () => {
    
    useEffect(() => {
        Router.push('/');
    }, [])

    return (
        <Layout>
            <h1>404임미당~!@ㅋㅎ</h1>
            <button onClick={move}>이동</button>
        </Layout>
    )
}

export default Custom404;
